import{_ as t}from"./plugin-vue_export-helper.21dcd24c.js";import{r,o as i,c as n,a as e,b as c,e as h,d as p}from"./app.5166dee0.js";const o={},s=h('<h2 id="\u5199\u5728\u524D\u9762" tabindex="-1"><a class="header-anchor" href="#\u5199\u5728\u524D\u9762" aria-hidden="true">#</a> \u5199\u5728\u524D\u9762</h2><p>\u5927\u5BB6\u597D\uFF0C\u6211\u662F\u5C0F\u725B\uFF0C\u5FAE\u8F6F\u7A0B\u5E8F\u5458\u4E00\u540D\u3002\u597D\u4E45\u6CA1\u66F4\u65B0\u4E86\uFF0C\u6700\u8FD1\u79CB\u62DB\u5F00\u542F\uFF0C\u5148\u63A5\u7740\u6765\u53D1\u4E00\u6CE2\u65B0\u7684\u516B\u80A1\u6587\u80CC\u8BF5\u7248\u7CFB\u5217\uFF0C\u589E\u52A0\u4E86\u4E00\u4E9B\u4ECA\u5E74\u770B\u5230\u7684\u65B0\u9898\u3002</p><p>\u5927\u5BB6\u53EF\u4EE5\u5173\u6CE8\u4E0B\u65B9\u516C\u4F17\u53F7\uFF0C\u56DE\u590D\u5173\u952E\u8BCD\uFF1Ainterviewtop \u83B7\u53D6\u9898\u5E93pdf\u7248\u3002</p><p>\u540C\u65F6\uFF0C\u6211\u4EEC\u6839\u636E\u9898\u5E93\uFF0C\u4E5F\u5F00\u53D1\u4E86\u4E92\u8054\u7F51\u9898\u5E93\u5728\u7EBF\u7F51\u7AD9\uFF1A\u4E5F\u6709\u4E0D\u5C11\u70ED\u5FC3\u7684\u7F51\u53CB\u8D21\u732E\u4E86\u9762\u8BD5\u7ECF\u5386\u3002\u9898\u5E93\u8FD8\u5904\u4E8E\u66F4\u65B0\u4E2D\uFF0C\u6B22\u8FCE\u5927\u5BB6\u8BBF\u95EE\u3002http://interviewtop.top\u3002\u540C\u65F6\uFF0C\u6211\u7684\u516C\u4F17\u53F7\u4E5F\u4F1A\u53D1\u4E00\u70B9\u5E7F\u544A\uFF0C\u8D1F\u62C5\u4E00\u4E0B\u670D\u52A1\u5668\u6210\u672C\uFF0C\u5E0C\u671B\u5927\u5BB6\u8C05\u89E3\u3002</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/weixin-yinhkfgqzgl-2c79f6ed-1495-4188-88d7-50403a9fe6dc.jpg" alt=""></p><p>\u76EE\u524D\u9898\u5E93\u8986\u76D6\u516C\u53F8\u6709\uFF1A\u5404\u7C7B\u94F6\u884C\u79D1\u6280\u5C97\uFF0C\u767E\u5EA6\uFF0C\u963F\u91CC\uFF0C\u5B57\u8282\uFF0C\u817E\u8BAF\uFF0C\u7F8E\u56E2\uFF0C\u5FEB\u624B\uFF0C\u7F51\u6613\uFF0C\u534E\u4E3A\uFF0Cshopee\uFF0C\u4EAC\u4E1C\u3002</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/weixin-yinhkfgqzgl-6257f286-c1e8-479f-a255-50a36d43cacd.jpg" alt=""></p><p>\u9898\u5E93\u5305\u62EC\uFF1A\u8BA1\u7B97\u7F51\u7EDC\uFF0C\u64CD\u4F5C\u7CFB\u7EDF\uFF0C\u6570\u636E\u5E93\uFF0CRedis\uFF0CJava\u57FA\u7840\uFF0CJava\u591A\u7EBF\u7A0B\uFF0CJava\u865A\u62DF\u673A\uFF0C\u8BBE\u8BA1\u6A21\u5F0F\uFF0C\u6570\u636E\u7ED3\u6784\u4E0E\u7B97\u6CD5\u3002</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/weixin-yinhkfgqzgl-95d7d915-4177-4508-b75f-7b8c087b82f8.jpg" alt=""></p><p>\u5927\u5BB6\u53EF\u4EE5\u8FDB\u5165\u7F51\u7AD9\u641C\u7D22\u5927\u5382\u5BF9\u5E94\u9898\u5E93\u7684\u9AD8\u9891\u9762\u8BD5\u9898\u3002</p><h2 id="\u5199\u5728\u524D\u9762-1" tabindex="-1"><a class="header-anchor" href="#\u5199\u5728\u524D\u9762-1" aria-hidden="true">#</a> \u5199\u5728\u524D\u9762</h2><p>\u4ECA\u5E74\u79CB\u62DB\uFF0C\u5404\u5927\u5382HC\u9AA4\u51CF\uFF0C\u53C8\u56E0\u4E3A\u5F53\u5E74\u75AB\u60C5\u7684\u6269\u62DB\uFF0C\u5BFC\u81F4\u4ECA\u5E74\u62DB\u8058\u683C\u5916\u8270\u8F9B\uFF0C\u4E0D\u5C11\u670B\u53CB\u76EE\u524D\u73B0\u5728\u624B\u91CC\u8FD8\u662F\u6CA1\u6709offer\u3002\u4ECA\u5929\u5C31\u5206\u4EAB\u4E00\u4E0B\u6211\u5F53\u5E74\u5199\u7684\u4E00\u7BC7\u5173\u4E8E\u94F6\u884CIT\u6C42\u804C\u5C97\u7684\u6587\u7AE0\uFF0C\u5E0C\u671B\u80FD\u5BF9\u8BFB\u8005\u670B\u53CB\u4EEC\u5E26\u6765\u5E2E\u52A9\u3002</p><h2 id="\u56FD\u6709\u884C" tabindex="-1"><a class="header-anchor" href="#\u56FD\u6709\u884C" aria-hidden="true">#</a> \u56FD\u6709\u884C</h2><p>\u56FD\u6709\u884C\u7684\u7B14\u8BD5\u90FD\u662F\u884C\u6D4B\uFF08\u8BED\u8A00\u7406\u89E3\u3001\u903B\u8F91\u63A8\u7406\u3001\u8D44\u6599\u5206\u6790\u3001\u6570\u5B66\u8FD0\u7B97\u3001\u94F6\u884C\u57FA\u7840\u3001\u65F6\u653F\uFF09+\u8BA1\u7B97\u673A\u57FA\u7840\uFF08Java\u3001\u6570\u636E\u5E93\u3001c\u8BED\u8A00\u3001\u8BA1\u7B97\u673A\u7F51\u7EDC\u7B49\uFF09+\u82F1\u8BED\uFF08\u5355\u9009\u3001\u9605\u8BFB\u7406\u89E3\u3001\u9009\u8BCD\u586B\u7A7A\uFF09+\u6027\u683C\u6D4B\u8BD5\uFF08\u6709\u7684\u884C\u4F1A\u5355\u72EC\u8FDB\u884C\u6027\u683C\u6D4B\u8BD5\uFF09\uFF0C\u603B\u7684\u6765\u8BF4\u65F6\u95F4\u6BD4\u8F83\u7D27\u5F20\uFF0C\u6CA1\u6709\u8FC7\u591A\u601D\u8003\u7684\u65F6\u95F4\uFF0C\u6240\u4EE5\u5F97\u4FDD\u8BC1\u6B63\u786E\u7387\u53BB\u505A\uFF0C\u53EF\u4EE5\u63D0\u524D\u591A\u7EC3\u7EC3\u76F8\u5173\u7684\u9898\u76EE\u3002\u57FA\u672C\u7B14\u8BD5\u901A\u8FC7\uFF0C\u9762\u8BD5\u95EE\u9898\u90FD\u4E0D\u5927\uFF0C\u8BA4\u771F\u51C6\u5907\u90FD\u662F\u53EF\u4EE5\u901A\u8FC7\u7684\u3002\u56FD\u6709\u884C\u603B\u7684\u6765\u8BF4\u52A0\u73ED\u8FD8\u884C\uFF0C\u57FA\u672C\u90FD\u6709\u53CC\u4F11\uFF0C\u4F46\u6BCF\u4E2A\u6708\u4F1A\u6709\u4E00\u6B21\u6295\u4EA7\u6240\u4EE5\u80AF\u5B9A\u4F1A\u52A0\u73ED\uFF0C\u5176\u4ED6\u65F6\u95F4\u636E\u4E86\u89E3\u76F8\u5BF9\u6765\u8BF4\u5F3A\u5EA6\u4E00\u822C\u3002\u56FD\u6709\u884C\u5BF9\u5B66\u5386\u6BD4\u8F83\u770B\u91CD\u3002</p><h2 id="\u5546\u4E1A\u94F6\u884C" tabindex="-1"><a class="header-anchor" href="#\u5546\u4E1A\u94F6\u884C" aria-hidden="true">#</a> \u5546\u4E1A\u94F6\u884C</h2><p>\u5546\u4E1A\u94F6\u884C\u76F8\u5BF9\u56FD\u6709\u884C\u5BF9\u7F16\u7A0B\u7684\u8981\u6C42\u9AD8\u4E00\u4E9B\uFF0C\u9700\u8981\u505A\u597D\u51C6\u5907\u3002\u5546\u4E1A\u7C7B\u94F6\u884C\u4E00\u822C\u4E5F\u66F4\u559C\u6B22\u62DB\u7537\u751F\u3002</p><p>\u5546\u4E1A\u7C7B\u94F6\u884C</p><p>\u6D59\u5546\u94F6\u884C\uFF08base\uFF1A\u897F\u5B89\u3001\u676D\u5DDE\uFF09 \u6D59\u5546\u5B50\u516C\u53F8\u4E3A\u6613\u4F01\u94F6\uFF0C\u4E00\u822C\u90FD\u662F\u8FDB\u5B50\u516C\u53F8\u6613\u4F01\u94F6\uFF0C\u603B\u884C\u62DB\u7684\u8F83\u5C11</p><p>\u7B14\u8BD5\uFF1A\u8F83\u7B80\u5355\uFF0C\u5355\u9009\uFF08\u8BA1\u7F51\u3001\u6570\u636E\u5E93\u3001Java\u4E4B\u7C7B\u7684\uFF09+\u95EE\u7B54\uFF08\u5173\u4E8E\u91D1\u878D\u884C\u4E1A\u7684\uFF09</p><p>\u9762\u8BD5\uFF1A\uFF08\u5F88\u8FF7\uFF0C\u7384\u5B66\uFF1B\u6BD4\u8F83\u770B\u91CD\u5B66\u5386\uFF09</p><p>1-2\u9762\uFF0C\u7EBF\u4E0B\u7684\u8BDD\u53EA\u6709\u4E00\u976210-15\u5206\u949F\u57FA\u672C\u5C31\u662F\u9879\u76EE\u76F8\u5173\u52A0\u57FA\u7840\uFF1B\u7EBF\u4E0A\u4E24\u9762\uFF1A\u4E00\u9762\u7B80\u5355\u81EA\u6211\u4ECB\u7ECD\uFF0C\u4E8C\u9762\u5C31\u9879\u76EE\u57FA\u7840</p><p>\u5B81\u6CE2\u94F6\u884C\uFF08base\uFF1A\u5B81\u6CE2\uFF09 \u6CE2\u884C\u7684\u91D1\u878D\u79D1\u6280\u5C97</p><p>\u7B14\u8BD5\uFF1A\u5355\u9009+\u591A\u9009\uFF0C\u7ED9\u7684\u65F6\u95F4\u5F88\u5145\u8DB3\u53EF\u4EE5\u6162\u6162\u505A\uFF0C\u8FD8\u662F\u6709\u70B9\u96BE\u7684\uFF0C\u8BBE\u8BA1spring\u6846\u67B6\uFF0C\u524D\u7AEF\uFF1B\u4F46\u57FA\u672C\u90FD\u80FD\u8FC7</p><p>\u9762\u8BD5\uFF1A\u56DB\u9762\uFF0C\u4E00\u9762\u6280\u672F\u976210\u5206\u949F\u5DE6\u53F3\uFF1B\u4E8C\u9762\u624D\u827A\u5C55\u793A\uFF08\u5F88\u8FF7\uFF09\uFF1B\u4E09\u9762\u884C\u653F\u9762\u5C31\u662F\u7C7B\u4F3CHR\u9762\u95EE\u4E3A\u5565\u6765\u6CE2\u884C\u4E4B\u7C7B\u7684\uFF1B\u56DB\u9762\u7EC8\u9762\uFF1A\u9009\u8BCD\u8FDB\u884C\u4E24\u5206\u949F\u7684\u6F14\u8BB2 \u6D41\u7A0B\u771F\u7684\u592A\u6162\u592A\u6162\u4E86\uFF0C\u53EF\u80FD\u94F6\u884C\u7684\u901A\u75C5\u5427\u3002\u3002\u3002</p><p>\u6D66\u53D1\u94F6\u884C\uFF08\u6D66\u53D1\u57FA\u672C\u5DF2\u5B50\u516C\u53F8\u5316\uFF09 \u7B14\u8BD5\uFF1A\u6709\u4E24\u573A\u5206\u522B\u662F\u5728\u7EBF\u673A\u8003+\u5728\u7EBF\u7B14\u8BD5\uFF0C\u5728\u7EBF\u673A\u8003\uFF1A\u9009\u62E920\u9053+3 \u9053\u7F16\u7A0B\uFF0C\u96BE\u5EA6\u4E0D\u5927\uFF1B\u5728\u7EBF\u7B14\u8BD5\uFF1A\u82F1\u8BED+\u884C\u6D4B\u4E4B\u7C7B\u7684</p><p>\u9762\u8BD5\uFF1A\u5C31\u4E00\u9762\uFF0C\u9996\u5148\u662F2\u5206\u949F\u7684\u6F14\u8BB2\uFF0C\u7ED9\u5B9A\u6750\u6599\u601D\u8003\u4E00\u5206\u949F\u8FDB\u884C2\u5206\u949F\u5373\u5174\u6F14\u8BB2\uFF1B10-15\u5206\u949F\u9879\u76EE+Java\u57FA\u7840</p><p>\u4E0A\u6D77\u94F6\u884C \u7B14\u8BD5\uFF1A\u5148\u9762\u8BD5\u518D\u7B14\u8BD5</p><p>\u9762\u8BD5\uFF1A\u4E00\u9762\uFF1A\u6280\u672F\u9762\uFF0C\u6211\u9047\u5230\u7684\u9762\u8BD5\u5B98\u6B7B\u6263\u5404\u79CD\u7EC6\u8282\uFF0C\u4E0D\u8FC7\u4E5F\u662F\u57FA\u7840\u77E5\u8BC6\uFF0C\u5C5E\u4E8E\u94F6\u884C\u9762\u8BD5\u4E2D\u5BF9\u6280\u672F\u8981\u6C42\u6BD4\u8F83\u9AD8\u7684\uFF0C\u9762\u8BD5\u901A\u8FC7\u518D\u53D1\u7B14\u8BD5\uFF0C\u7136\u540E\u4F1A\u9762\u8C08\uFF0C\u804A\u4E00\u4E9B\u57FA\u672C\u60C5\u51B5\u548C\u610F\u613F\u7B49\uFF0C\u63A5\u4E0B\u6765\u5C31\u662F\u9012\u4EA4\u8D44\u6599\uFF0C\u4F1A\u6839\u636E\u6210\u7EE9\u7B5B\u4EBA\uFF0C\u6709\u6302\u79D1\u4E0D\u884C\uFF0C75\u5206\u4EE5\u4E0B\u79D1\u76EE\u8FC7\u591A\u4E5F\u4E0D\u884C\u3002</p><p>\u62DB\u5546\u94F6\u884C\uFF08\u5206\u884C\uFF09 \u7B14\u8BD5\uFF1A\u6B66\u6C49\u5206\u884C\u662F\u9996\u5148\u4E00\u8F6E\u884C\u6D4B\u9898\uFF0C\u4E8C\u9762\u901A\u8FC7\u540E\u6280\u672F\u7B14\u8BD5\uFF08\u57FA\u672C\u90FD\u662F\u725B\u5BA2\u539F\u9898\uFF09</p><p>\u9762\u8BD5\uFF1A\u5BA3\u8BB2\u4F1A\u8FDB\u884C\u7684\u4E00\u9762\uFF0C\u7C7B\u4F3Chr\u9762\uFF1B\u7EBF\u4E0B\u4E8C\u9762\uFF08\u7ED3\u6784\u5316\u7FA4\u9762\uFF09\uFF1B\u7EBF\u4E0B\u4E09\u9762\uFF08\u7FA4\u9762\uFF0C\u5173\u4E8E\u4E00\u4E2A\u95EE\u9898\u62A2\u7B54\u81EA\u5DF1\u7684\u60F3\u6CD5\uFF09</p><p>\u62DB\u5546\u94F6\u884C\u4FE1\u7528\u5361\u4E2D\u5FC3 \u8BE5\u90E8\u95E8\u4E2A\u4EBA\u611F\u89C9\u548C\u4E92\u8054\u7F51\u516C\u53F8\u5DEE\u4E0D\u591A</p><p>\u7B14\u8BD5\uFF1A\u7C7B\u4F3C\u4E92\u8054\u7F51\u516C\u53F8\u7B14\u8BD5\uFF0C\u725B\u5BA2\u7F51\u6709\u771F\u9898</p><p>\u9762\u8BD5\uFF1A\u4E00\u8F6E\u7535\u8BDD\u9762\uFF0C\u4E00\u8F6E\u7EBF\u4E0B\u9762\u8BD5\u3002\u62DB\u884C\u7684\u62DB\u8058\u56E2\u4F1A\u5728\u5168\u56FD\u5404\u5730\u8DD1\uFF0C\u901A\u8FC7\u7535\u8BDD\u9762\u7684\u540C\u5B66\u4F1A\u88AB\u5B89\u6392\u53BB\u5C31\u8FD1\u57CE\u5E02\u9762\u8BD5\u3002\u9762\u8BD5\u7684\u8BDD\uFF0C\u6280\u672F\u4E3B\u7BA1\u548Chr\u5728\u4E00\u5757\uFF0C\u4E00\u8D77\u9762\u8BD5\u3002</p><p>\u62DB\u94F6\u7F51\u7EDC\u79D1\u6280\uFF08\u5B50\u516C\u53F8\uFF09 \u53EF\u80FD\u662F\u6700\u65E9\u62DB\u8058\u7684\u516C\u53F8\uFF0C\u516D\u6708\u5C31\u62DB\u8058\u4E86</p><p>\u7B14\u8BD5\uFF1A\u7C7B\u4F3C\u4E92\u8054\u7F51\u516C\u53F8\u7B14\u8BD5</p><p>\u9762\u8BD5\uFF1A\u4E24\u8F6E\u6280\u672F\u9762\uFF0C\u4E00\u8F6E\u7EBF\u4E0B\u9762\u8BD5\u3002\u62DB\u884C\u7684\u62DB\u8058\u56E2\u4F1A\u5728\u5168\u56FD\u5404\u5730\u8DD1\uFF0C\u901A\u8FC7\u7535\u8BDD\u9762\u7684\u540C\u5B66\u4F1A\u88AB\u5B89\u6392\u53BB\u5C31\u8FD1\u57CE\u5E02\u9762\u8BD5\u3002\u9762\u8BD5\u7684\u8BDD\uFF0C\u6280\u672F\u4E3B\u7BA1\u548Chr\u5728\u4E00\u5757\uFF0C\u4E00\u8D77\u9762\u8BD5\u3002</p><h2 id="\u56FD\u6709\u884C-1" tabindex="-1"><a class="header-anchor" href="#\u56FD\u6709\u884C-1" aria-hidden="true">#</a> \u56FD\u6709\u884C</h2><p>\u519C\u884C \u603B\u884C\u76F4\u5C5E\u673A\u6784\u8F6F\u4EF6\u4E2D\u5FC3\uFF08base\uFF1A\u5317\u4EAC\u3001\u4E0A\u6D77\u3001\u897F\u5B89\u3001\u5E7F\u5DDE\u3001\u6B66\u6C49\uFF09</p><p>\u7B14\u8BD5\uFF1A\u82F1\u8BED+\u884C\u6D4B\uFF08\u9009\u62E9\u9898\u65F6\u95F4\u5F88\u7D27\u5F20\uFF0C\u505A\u4E0D\u5B8C\u554A\u3002\u3002\uFF09+3\u9053\u7F16\u7A0B\uFF08\u65F6\u95F4\u8FC7\u4E8E\u5145\u88D5\uFF09+\u6027\u683C\u6D4B\u8BD5</p><p>\u9762\u8BD5\uFF1A\u6839\u636E\u7B14\u8BD5\u6210\u7EE9\u5206\u6279\u6B21\u8FDB\u884C\u7684\u9762\u8BD5\uFF0C\u7B14\u8BD5\u9762\u8BD5\u6210\u7EE9\u5404\u536050%\u3002\u5927\u90E8\u5206\u5730\u533A\u662F\u5355\u9762\uFF0C\u6B66\u6C49\u62A5\u7684\u4EBA\u591A\u662F\u4E24\u4EBA\u4E00\u8D77\u9762\u8BD5\uFF0C\u5BF9\u6BD4\u5B9E\u5728\u8FC7\u4E8E\u660E\u663E\uFF0C\u6280\u672F\u95EE\u9898\u6BD4\u8F83\u57FA\u7840\uFF0C\u4F46\u662F\u4F1A\u6BD4\u8F83\u6DF1\u5165\u95EE\u7EC6\u8282\uFF0C\u8981\u591A\u52A0\u51C6\u5907\u3002</p><p>\u5DE5\u5546\u94F6\u884C \u603B\u884C\u76F4\u5C5E\u673A\u6784\u8F6F\u4EF6\u4E2D\u5FC3\uFF08base\uFF1A\u5317\u4EAC\u3001\u4E0A\u6D77\u3001\u897F\u5B89\u3001\u73E0\u6D77\u3001\u6210\u90FD\uFF09</p><p>\u7B14\u8BD5\uFF1A\u82F1\u8BED+\u884C\u6D4B\u4E4B\u7C7B\u7684</p><p>\u9762\u8BD5\uFF1A\u56E0\u4E3A\u662F\u6765\u5B66\u6821\u8FDB\u884C\u5BA3\u8BB2+\u9762\u8BD5\uFF0C\u4E00\u9762\uFF0C\u5982\u679C\u9762\u8BD5\u901A\u8FC7\u53EA\u8981\u7B14\u8BD5\u901A\u8FC7\u5C31\u53EF\u4F53\u68C0\u8D70\u540E\u7EED\u6D41\u7A0B\uFF1B\u82E5\u9762\u8BD5\u672A\u901A\u8FC7\u5C31\u6B63\u5E38\u8D70\u7F51\u4E0A\u6D41\u7A0B\u7B14\u8BD5\u5B8C\u901A\u8FC7\u7EE7\u7EED\u9762\u8BD5\uFF1B\u9762\u8BD510-15\u5206\u949F\uFF0C\u5F88\u7B80\u5355\u5C31\u662F\u9879\u76EE+\u57FA\u7840\u968F\u4FBF\u95EE\u95EE</p><p>\u4E2D\u56FD\u94F6\u884C \u603B\u884C\u76F4\u5C5E\u673A\u6784\u8F6F\u4EF6\u4E2D\u5FC3\uFF08base\uFF1A\u5317\u4EAC\u3001\u4E0A\u6D77\u3001\u897F\u5B89\u3001\u5408\u80A5\uFF09</p><p>\u7B14\u8BD5\uFF1A\u82F1\u8BED\uFF08\u9898\u91CF\u8D3C\u5927\uFF0C\u8DDF\u8003\u56DB\u516D\u7EA7\u4E00\u6837\uFF0C35\u5206\u949F\u4E09\u4E2A\u9605\u8BFB\u7406\u89E3\u597D\u50CF\uFF09+\u884C\u6D4B\u4E4B\u7C7B\u7684</p><p>\u9762\u8BD5\uFF1A\u4E00\u9762\uFF0C\u9762\u8BD5\u4F53\u9A8C\u771F\u4E0D\u597D\u54E6\uFF0C\u7B49\u4E00\u65E9\u4E0A\u5019\u573A\u7B49\u5F85\u4F1A\u6536\u624B\u673A\uFF0C\u5750\u7740\u7B49\u88AB\u53EB\u53F7\uFF0C\u9762\u8BD515\u5206\u949F\u5DEE\u4E0D\u591A\uFF0C\u4E5F\u662F\u7ED9\u4E00\u6BB5\u6750\u6599\u968F\u4FBF\u6F14\u8BB22\u5206\u949F\uFF0C\u7136\u540E\u95EE\u7B80\u5386\u9879\u76EE</p><p>\u4EA4\u901A\u94F6\u884C \u603B\u884C\u76F4\u5C5E\u673A\u6784\u8F6F\u4EF6\u4E2D\u5FC3\uFF08base\uFF1A\u5317\u4EAC\u3001\u4E0A\u6D77\uFF09</p><p>\u7B14\u8BD5\uFF1A\u4E09\u5C0F\u65F6\u884C\u6D4B\uFF0C\u6709\u4E24\u9053\u7F16\u7A0B</p><p>\u9762\u8BD5\uFF1A\u4E00\u9762\u662F\u6280\u672F\u9762\uFF0C\u95EE\u9898\u4E0D\u591A\uFF0C\u8F83\u57FA\u7840\uFF1B\u7EC8\u9762\u7C7B\u4F3Chr\u9762\uFF0C\u4E5F\u6D89\u53CA\u4E86\u4E00\u70B9\u70B9\u70B9\u6280\u672F\u95EE\u9898\uFF0C\u96BE\u5EA6\u4E0D\u5927</p><p>\u90AE\u50A8 \u603B\u884C\u76F4\u5C5E\u673A\u6784\u8F6F\u4EF6\u4E2D\u5FC3\uFF08base\uFF1A\u5317\u4EAC\u3001\u4E0A\u6D77\u3001\u897F\u5B89\u3001\u5408\u80A5\u3001\u6210\u90FD\uFF09</p><p>\u7B14\u8BD5\uFF1A\u82F1\u8BED+\u884C\u6D4B\u4E4B\u7C7B\u7684</p><p>\u9762\u8BD5\uFF1A\u4E00\u9762\u7EBF\u4E0A\u65E0\u9886\u5BFC\u5C0F\u7EC4\u8BA8\u8BBA\uFF0C\u7ED9\u4E00\u4E2A\u95EE\u9898\u7684\u4E0D\u540C\u89E3\u51B3\u65B9\u6848\u6309\u91CD\u8981\u6027\u8FDB\u884C\u6392\u5E8F \u4E8C\u976210\u5206\u949F\u6280\u672F\u52A0HR\u9762\u95EE\u7684\u90FD\u86EE\u57FA\u7840\u7684</p><h2 id="\u653F\u7B56\u6027\u94F6\u884C" tabindex="-1"><a class="header-anchor" href="#\u653F\u7B56\u6027\u94F6\u884C" aria-hidden="true">#</a> \u653F\u7B56\u6027\u94F6\u884C</h2><p>\u519C\u4E1A\u53D1\u5C55\u94F6\u884C \u73E0\u6D77\u7814\u53D1\u57FA\u5730\uFF08\u4E0E\u5317\u4EAC\u4E00\u6837\u5C5E\u4E8E\u603B\u884C\u7F16\u5236\uFF0C\u5317\u4EAC\u62DB\u8FD0\u7EF4\u548C\u4FE1\u606F\u5B89\u5168\u5C97\uFF0C\u62DB\u8058\u4EBA\u6570\u5C11\uFF0C\u7ADE\u4E89\u6FC0\u70C8\uFF0C\u60F3\u8981\u5317\u4EAC\u6237\u53E3\u53EF\u4EE5\u8BD5\u8BD5\uFF1B\u73E0\u6D77\u4E3B\u8981\u62DB\u5F00\u53D1\u5C97\uFF0C2020\u5E74\u5F00\u59CB\u6269\u62DB\uFF0C\u62DB\u8058\u4EBA\u6570\u591A\uFF0C\u7ADE\u4E89\u6682\u65F6\u4E0D\u6FC0\u70C8\uFF0C\u9002\u5408\u5BB6\u5728\u5357\u65B9\u7684\u540C\u5B66\uFF09</p><p>\u7B14\u8BD5\uFF1A\u7B2C\u4E00\u8F6E\u662F\u884C\u6D4B\uFF0Cit\u5C97\u8FD8\u591A\u7B2C\u4E8C\u8F6E\u6280\u672F\u7B14\u8BD5\uFF08\u5341\u9053\u9009\u62E9\uFF0C6\u9053sql\uFF0C4\u9053\u7F16\u7A0B\uFF0C\u9898\u91CF\u592A\u5927\uFF09</p><p>\u9762\u8BD5\uFF1A\u8981\u6C42\u53BB\u73E0\u6D77\u7EBF\u4E0B\u9762\u8BD5\uFF0C\u9762\u8BD5\u53EA\u6709\u4E00\u8F6E\u6280\u672F\u9762\uFF0C\u8303\u56F4\u5927\uFF0C\u968F\u673A\u63D0\u95EE\uFF0C\u96BE\u5EA6\u4E0D\u5927\uFF0C\u6BD4\u8F83\u57FA\u7840\uFF0C\u4F46\u662F\u6B63\u597D\u89E6\u5230\u77E5\u8BC6\u76F2\u533A\u5C31\u5F88\u5012\u9709\u4E86\uFF0C\u7136\u540E\u7ACB\u5373\u8FDB\u884Chr\u9762\uFF0C\u534A\u5929\u7ED3\u675F\u9762\u8BD5\u6D41\u7A0B\uFF0C\u4F46\u662F\u51FA\u901A\u77E5\u4F1A\u5F88\u6162\uFF0C\u94F6\u884C\u7684\u901A\u75C5\u4E86\u3002</p><p>\u5E0C\u671B\u5927\u5BB6\u90FD\u80FD\u6210\u529F\u4E0A\u5CB8\uFF0C\u52A0\u6CB9\uFF01</p>',57),d=p("\u53C2\u8003\u94FE\u63A5\uFF1A"),l={href:"https://mp.weixin.qq.com/s/LBLsM4MW2KMCtaMr3hZcwQ",target:"_blank",rel:"noopener noreferrer"},b=p("https://mp.weixin.qq.com/s/LBLsM4MW2KMCtaMr3hZcwQ"),f=p("\uFF0C\u51FA\u5904\uFF1A\u540E\u7AEF\u6280\u672F\u5C0F\u725B\u8BF4\uFF0C\u6574\u7406\uFF1A\u6C89\u9ED8\u738B\u4E8C");function _(m,g){const a=r("ExternalLinkIcon");return i(),n("div",null,[s,e("blockquote",null,[e("p",null,[d,e("a",l,[b,c(a)]),f])])])}var u=t(o,[["render",_],["__file","yinhkfgqzgl.html.vue"]]);export{u as default};
